{{ if not .Values.enable_provisioning }}
---
apiVersion: openunison.tremolo.io/v1
kind: PortalUrl
metadata:
  name: k8sdb
  namespace: {{ .Release.Namespace }}
spec:
  label: Kubernetes Dashboard
  org: b1bf4c92-7220-4ad2-91af-ee0fe0af7312
  url: https://#[K8S_DASHBOARD_HOST]
  icon: 
  azRules:
  - constraint: o=Tremolo
    scope: dn
---
apiVersion: openunison.tremolo.io/v1
kind: PortalUrl
metadata:
  name: oauth2token
  namespace: {{ .Release.Namespace }}
spec:
  label: Kubernetes Tokens
  org: b1bf4c92-7220-4ad2-91af-ee0fe0af7312
  url: /k8stoken/
  icon: 
  azRules:
  - constraint: o=Tremolo
    scope: dn
{{ end }}